import * as React from "react";
import TextField from "@mui/material/TextField/index.js";
import Button from "@mui/material/Button/index.js";
import Dialog from "@mui/material/Dialog/index.js";
import DialogActions from "@mui/material/DialogActions/index.js";
import DialogContent from "@mui/material/DialogContent/index.js";
import DialogContentText from "@mui/material/DialogContentText/index.js";
import DialogTitle from "@mui/material/DialogTitle/index.js";

import {
  deleteWishlist,
  getAllWishlists,
  postWishlist,
} from "../../api/wishlistApi.js";

export default function PostDialog() {
  const [open, setOpen] = React.useState(false);
  const [year, setYear] = React.useState(2023);
  const [child, setChild] = React.useState({
    firstname: "",
    lastname: "",
    age: 0,
  });
  const [items, setItems] = React.useState([{ name: "", currentprice: 0 }]);

  const handleAddWishlist = () => {
    const formData = {
      year: year,
      child: { ...child },
      items: [...items],
    };
    postWishlist(formData);
    handleClose();
    window.location.reload();
  };

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };
  const handleAddItem = () => {
    setItems((prevItems) => [...prevItems, { name: "", currentprice: 0 }]);
  };
  const handleRemoveItem = (id) => {
    setItems((prevItems) => prevItems.filter((item) => item._id !== id));
  };

  const handleItemNameChange = (id, newName) => {
    setItems((prevItems) =>
      prevItems.map((item) =>
        item._id === id ? { ...item, name: newName } : item
      )
    );
  };

  const handleItemPriceChange = (id, newPrice) => {
    setItems((prevItems) =>
      prevItems.map((item) =>
        item._id === id ? { ...item, currentprice: newPrice } : item
      )
    );
  };

  const handleAdd = () => {
    handleAddWishlist();
  };

  return (
    <React.Fragment>
      <Button variant="contained" sx={{ m: 2 }} onClick={handleClickOpen}>
        Add Wishlist
      </Button>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add Wishlist</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Please fill out the form below to add a wishlist.
          </DialogContentText>
          <TextField
            label="Year"
            value={year}
            onChange={(e) => setYear(e.target.value)}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Child's First Name"
            value={child.firstname}
            onChange={(e) => setChild({ ...child, firstname: e.target.value })}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Child's Last Name"
            value={child.lastname}
            onChange={(e) => setChild({ ...child, lastname: e.target.value })}
            fullWidth
            margin="normal"
          />
          <TextField
            label="Child's Age"
            value={child.age}
            type="number"
            onChange={(e) =>
              setChild({ ...child, age: parseInt(e.target.value) })
            }
            fullWidth
            margin="normal"
          />
          {items.map((item) => (
            <div key={item._id}>
              <TextField
                label="Item Name"
                value={item.name}
                onChange={(e) => handleItemNameChange(item._id, e.target.value)}
                fullWidth
                margin="normal"
              />
              <TextField
                label="Item Price"
                value={item.currentprice}
                type="number"
                onChange={(e) => {
                  const updatedItems = items.map((i) =>
                    i.id === item._id
                      ? { ...i, currentprice: parseFloat(e.target.value) }
                      : i
                  );
                  setItems(updatedItems);
                }}
                fullWidth
                margin="normal"
              />
              <Button onClick={() => handleRemoveItem(item._id)}>
                Remove Item
              </Button>
            </div>
          ))}
          <Button onClick={handleAddItem}>Add Item</Button>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleAdd}>Add</Button>
        </DialogActions>
      </Dialog>
    </React.Fragment>
  );
}
